import HomePage from './Pages/Home/HomePages';

import {BrowserRouter , Routes , Route} from 'react-router-dom'

function App() {
  return (
    <div>
    <BrowserRouter>
    <Routes>
      <Route index element={ <HomePage/>}  />
    </Routes>
   </BrowserRouter>
    </div>
  );
}

export default App;
